using System;\nusing System.Text;\nusing Murmur;\n\nclass Program\n{\n    static void Main()\n    {\n        var text = "your string here";\n        var encoding = Encoding.UTF8;\n        byte[] data = encoding.GetBytes(text);\n\n        uint seed = 0; // You can change the seed as needed for your application\n\n        // Compute hash using MurmurHash3_128\n        var murMurHash128 = MurmurHash.Create128(seed);\n        ulong hashValue = murMurHash128.ComputeHash(data);\n\n        Console.WriteLine($"MurmurHash3_128 hash: {hashValue}");\n    }\n}